// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract UserStorage {
    struct User {
        string name;
        string email;
        string password;
    }

    mapping(string => User) public users;

    event UserAdded(string email);

    function addUser(string memory _name, string memory _email, string memory _password) public {
        require(bytes(users[_email].email).length == 0, "User already exists");
        users[_email] = User(_name, _email, _password);
        emit UserAdded(_email);
    }

    function getUser(string memory _email) public view returns (string memory, string memory, string memory) {
        User memory user = users[_email];
        require(bytes(user.email).length > 0, "User does not exist");
        return (user.name, user.email, user.password);
    }
}
